Responsibilities include: 
- managing a portfolio of 3 directors; 
- coordinating and organising all social and sporting events associated with the UTS LSS; 
- managing an activities budget in excess of $100,000.00 per year; and 
- organising the UTS LSS Orientation Camp of 150 students.

As a part-time employee of Thompson Cooper Lawyers, I worked 2 days per week as a law clerk. This position gave me extensive insight into the nature of commercial litigation, specifically insurance litigation. My responsibilities include: 
- research on legal and procedural issues relating to insurance law; 
- filing court documents at the Local, District and Supreme Courts; 
- preparing and delivering briefs to barristers; 
- preparing and uplifting subpoenas; and
- using AFFINITY to diligently recording time.

As a part-time legal assistant at Robert C. Minter Lawyer, I worked 2-3 days per week, gaining extensive insight into the nature of commercial practice and significantly expanding my practical legal skills. My responsibilities included: 
- research on a wide range of legal and procedural issues; 
- drafting letters to clients including letters of advice and letters to the ‘other side’; 
- requesting and responding to letters of particulars; 
- drafting contracts (primarily contracts for the sale of land and business);
- drafting deeds of assignment and deeds of consent to transfer; 
- correspondence with clients via telephone; 
- using LEAP accounting and LEAP documents to manage client time sheets and data; and 
- preparing new matters and booking initial consultations for prospective clients.

•  Senior partner with an extensive practice covering all aspects of commercial litigation/dispute resolution with particular expertise in disputes with complex legal and factual issues. 

•  Involved in many leading cases (at trial, on appeal and in the High Court of Australia) and has represented clients extensively  in mediation, arbitration, regulatory investigations and inquiries (including ICAC inquiries) and cross border matters involving foreign and international law.

Areas of legal expertise include:
•	Risk management and advice to boards as to crisis management;
•	contractual disputes;
•	litigation, dispute resolution and inquiries in highly regulated industries (including financial services and wagering) involving competition, administrative law, constitutional law;
•	professional, corporate and government negligence/ misconduct;
•	Anti-money laundering regulation and compliance;
•	Media and information technology.

Tom has a general practice with a particular focus on commercial litigation. He has appeared in cases in the District Court, Planning and Environment Court, Supreme Court and Court of Appeal across an array of practice areas. 

Tom has been retained, and accepts briefs, in matters concerning:
- Administrative Law; 
- Appellate Law; 
- Commercial Law; 
- Consumer Law;
- Construction Law;
- Contract;
- Corporations Law;
- Insolvency;
- Judicial Review; 
- Negligence;
- Planning and Environment Law;
- Property Law; 
- Taxation Appeals; and
- Trusts.

Assisted his Honour during matters including:

King v Adams [2016] NSWSC 1798 – dealing with fiduciary relationships and duties, oral contracts, implication of contractual terms and estoppel by convention (upheld on appeal in King v Adams & Ors [2017] NSWCA 277);

Thorn v Boyd [2016] NSWSC 1344 – dealing with unconscionability, equitable tracing, constructive trusts and s 66G sale of property (largely upheld on appeal in Boyd v Thorn [2017] NSWCA 210);

Malamit Pty Ltd v WFI Insurance Ltd [2016] NSWSC 1306 – dealing with the proper construction of a commercial insurance contract and entitlements of trust beneficiaries;

Robert Peter Campbell ATF the Joan Macpherson Trust and the Banandra Pastoral Settlement Trust [2016] NSWSC 1751 – the provision of judicial advice; and

Kathleen Jeanne Furlong & Mark Andrew Leishman (a bankrupt) v Wise & Young Pty Ltd & 2 Ors [2016] NSWSC 1839 – dealing with equitable interests in property, caveatable interests, the creation of trusts and the mingling and misappropriation of trust funds.

Senior Associate in the Employment, Pensions and Incentives team.

This role involves advising clients on a diverse range of industrial relations, general employment and workplace health and safety issues, including:
- advising on employment and industrial relations disputes including modern award, enterprise agreement and contract interpretation and compliance;
- advising on termination of employment, transfer of business and redundancy issues;
- workplace investigations;
- enterprise bargaining;
- bullying and harassment; 
- employment and industrial relations litigation including unfair dismissal, adverse action and discrimination claims;
- advising on the Fair Work Act 2009 (Cth).

I was employed in the corporate team as a paralegal on a part time basis. 

Duties included:
- researching procedural and legal issues; 
- maintaining precedents, updating firm guidelines on common topics and creating documents related to business development (particularly pitches); 
- assisted on Pepper Group’s initial public offering (worth AUD$471 million) by managing the execution of the signing process.

These duties showcased my communication skills, my ability to work with limited time constraints and my high level of commercial awareness.

I ran mentoring sessions for first year accounting, finance and economics subjects. These subjects have failures rates above 30%.
My role was to:
- prepare lesson plans and activities to deliver during mentoring sessions;
- work with other PASS leaders to develop a knowledge bank of activities.

This role highlighted my:
- planning and time management skills, needing to carefully plan sessions so that I do not re-teach the students and keep within the one-hour time limit;
- teamwork and interpersonal skills, needing to work, collaborate and communicate effectively with my peers;
- adaptability, in needing to make decisions based on different situations and circumstances as they arose.

Regular participants of my PASS sessions scored 11 marks higher than their peers. 3 former PASS students engaged me for private tutoring (in other subjects).

Management of EU-sponsored project in Libya focused on women's rights;
      management of office in Islamabad; proposals preparation for projects across MENA

      and South Asian regions.

I am a Senior Associate in the Employment, Pensions and Incentives team at Herbert Smith Freehills, with clients in a broad range of industries. 

My work is focused on advising on the employment aspects of commercial transactions, general employment advice and employment litigation, including: 
- employee claims, including for whistleblowing, adverse action, discrimination and unfair dismissal;
- executive employment arrangements, including issues arising under corporations legislation and the ASX Listing Rules;
- senior executive contracts and incentive schemes;
- strategic issues relating to the termination of employee and senior executive employment;
- the enforceability of post-employment restraints; and
- employment-related issues arising from corporate restructures and transfers of business.

