Worked in Self Managed Super Fund (SMSF) space for over 26 years, initially as an accountant & adviser to direct trustees of over 650 HNW funds. Lately Manoj is involved in the following activities:-

1) Created www.onlinesmsfaudit.com.au where an SMSF auditor can use a dynamic cloud checklist and issue final audit reports automatically online to trustees and save more than half the time to conduct an SMSF audit. In its first year ended September 2014 over 600 auditors had completed audits of 14,000 SMSF on the system. As on 1st Feb 2016, over 27,700 funds have been audited for financial year ended 30th June 2015 on the online portal by 738 auditors.

2) Assistant to a solicitor to develop one the most robust SMSF trust deed which creates about 15% of all funds;

3) SMSF Technical adviser to over 4,500 accountants Australia wide; providing 3rd level support on issues such as related trusts, borrowing, pensions, actuarial requirements etc.

4) Writing monthly strategies newsletter, technical papers on latest SMSF issues; The newsletter is subscribed by over 25,000 interested parties;

5) Family SMSF architect for selected less than 100 HNW families, where he helps them grow income, puts strategies for wealth protection and guides them on the complex path of financial freedom which lasts generations.

